INSERT INTO terms (term,definition,originator,example_use,created_at,updated_at) VALUES ('Secateurs','Indicative of an unfunny ''joke''. Originates from a tedious anecdote by Peter Cook confusing ''secateurs'' with ''sequitous'' or something equally forced. Became the benchmark for unfunniness when passed on by - who else - Ramsay. A new low (qv) in ''comedy''','Peter Cook','God knows. It was too boring to remember it. Someone can search out the message.','2016-05-27 19:18:07.019991','2016-05-27 19:18:07.019991');
